/* Actualizar bookings para liberar las reservas */
update bookings b
set "userId" = null, "statusId" = 1
where b.id in (
    select b.* from bookings b
        inner join seats s on b."seatId" = s.id
        inner join areas a on s."areaId" = a.id
        inner join floors f on a."floorId" = f.id
        inner join buildings as bl on f."buildingId" = bl.id
        inner join calendars c on b."calendarId" = c.id
    where bl.name = 'WTC Torre 4'
        and c.date >= '2021-09-20'
        and "userId" is not null
);

